import React from 'react';
// Importez vos composants ici
import Nav from './Nav';
import Hero from './Hero';
import Feature from './components/Feature/Feature';
import Form from '<div className="" />components/Form/SignInForm';
import Footer from './Footer/Footer';
import FeaturesList from './components/Feature/FeaturesList'; // Ajustez le chemin d'accès selon la structure de vos dossiers


function HomePage() {
  return (
    <div>
      <Nav />
      <main>
        <Hero />
        <Feature />
        <FeaturesList />
        {/* Vous pouvez inclure le composant Form ici ou ailleurs selon vos besoins */}
        <Form />
      </main>
      <Footer />
    </div>
  );
}

export default HomePage;
